import React from 'react';

import Card from '../../shared/components/UIElements/Card';
import GraffitiItem from './GraffitiItem';
import Button from '../../shared/components/FormElements/Button';
import './GraffitiList.css';

const GraffitiList = props => {
  if (props.items.length === 0) {
    return (
      <div className="graffiti-list center">
        <Card>
          <h2>No graffiti found. Maybe add one?</h2>
          <Button to="/graffiti/new">Share New Graffiti</Button>
        </Card>
      </div>
    );
  }

  return (
    <ul className="graffiti-list">
      {props.items.map(graffiti => (
        <GraffitiItem
          key={graffiti.id}
          id={graffiti.id}
          image={graffiti.image}
          title={graffiti.title}
          description={graffiti.description}
          address={graffiti.address}
          creatorId={graffiti.creator}
          coordinates={graffiti.location}
          onDelete={graffiti.onDeleteGraffiti}
        />
      ))}
    </ul>
  );
};

export default GraffitiList;
